import time

# Configure Tor browser path - this is the typical Linux path
tor_path = '/usr/bin/torbrowser-launcher'

def open_urls():
    try:
        with open('urls.txt', 'r') as file:
            urls = file.readlines()

        # Clean URLs (remove whitespace/newlines)
        urls = [url.strip() for url in urls if url.strip()]

        # Open each URL with a small delay to prevent overwhelming
        for url in urls:
            webbrowser.get(tor_path).open(url)
            time.sleep(1)  # 1 second delay between opens

    except Exception as e:
        print(f"Error: {e}")

if __name__ == "__main__":
    print("Opening URLs in Tor Browser...")
    open_urls()
    print("Done! All URLs have been opened.")"}
